import React, { useState } from 'react';
import { View, FlatList } from 'react-native';
import { Searchbar, List, Divider, Avatar, TouchableRipple } from 'react-native-paper';

const data = [
  { id: 1, name: 'John Doe', vehicleNo: 'ABC123', image: 'data:image/png;base64,' },
  { id: 2, name: 'Jane Smith', vehicleNo: 'XYZ789', image: 'data:image/png;base64,' },
  { id: 3, name: 'Bob Johnson', vehicleNo: 'DEF456', image: 'data:image/png;base64,' },
   { id: 4, name: 'Ann Barbera', vehicleNo: 'TUV678', image: 'data:image/png;base64,' },
   { id: 5, name: 'Joe Black', vehicleNo: 'HIJ777', image: 'data:image/png;base64,' },
   { id: 6, name: 'Hans Erick', vehicleNo: 'IJK001', image: 'data:image/png;base64,' },
];

const App = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [filteredData, setFilteredData] = useState(data);

  const handleSearch = (query) => {
    setSearchQuery(query);
    const filtered = data.filter((item) =>
      item.name.toLowerCase().includes(query.toLowerCase())
    );
    setFilteredData(filtered);
  };

  const handleItemClick = (item) => {
    // Handle navigation to another page for the selected item
    console.log('Navigate to page for:', item);
  };

  const renderItem = ({ item }) => (
    <TouchableRipple onPress={() => handleItemClick(item)}>
      <View>
        <List.Item
          title={item.name}
          description={`Vehicle No: ${item.vehicleNo}`}
          left={() => <List.Image source={{ uri: item.image }} size={48} />}
          right={() => <List.Icon icon="arrow-right" />}
        />
        <Divider />
      </View>
    </TouchableRipple>
  );

  return (
    <View>
      <Searchbar
        placeholder="Search"
        onChangeText={handleSearch}
        value={searchQuery}
      />
      <Divider />
      <FlatList
        data={filteredData}
        keyExtractor={(item) => item.id.toString()}
        renderItem={renderItem}
        ItemSeparatorComponent={() => <Divider />}
      />
    </View>
  );
};

export default App;
